import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import './App.css';
import HomeA from './components/Home/HomeA';
import BlogA from './components/Blog/BlogA';
import NavbarA from './components/Navbar/NavbarA';

function App() {

  return (
    <div className="App">
      <Router>
        <NavbarA />
        <Routes>
          <Route exact path="/"> <HomeA /> </Route>
          {/* <Route exact path="/blog"> <BlogA /> </Route> */}
        </Routes>
      </Router>

    </div>
  );
}

export default App;


